import React from 'react'
import { Link, NavLink } from 'react-router-dom';

export const Navbar = () => {
    return (
        <div>
            <nav className="navbar navbar-expand-lg navbar-light bg-info">
            <div className="container" >
                <Link className="-brand" to="/">LOGOO</Link>
            </div>
            </nav>
            
        </div>
    )
}
